webpackJsonp([825],{3697:function(module,exports){module.exports="@import '../common.scss';\n\n@mixin breadcrumbsHover($hoverTextColor, $hoverBackgroundColor) {\n  .item:not(.active):not(.disabled):hover {\n    border-radius: 100px;\n    color: $hoverTextColor;\n    background-color: $hoverBackgroundColor;\n  }\n}\n\n@mixin breadcrumbs($height, $sidePadding) {\n  .item {\n    display: inline-block;\n    height: $height;\n    line-height: $height;\n    padding: 0 $sidePadding;\n  }\n}\n\n.large {\n  @include breadcrumbs(36px, 14px);\n}\n\n.medium {\n  @include breadcrumbs(30px, 10px);\n}\n\n.onWhiteBackground {\n  @include breadcrumbsHover($D30, $B40);\n}\n\n.onGrayBackground {\n  @include breadcrumbsHover($D30, $D80);\n}\n\n.onDarkBackground {\n  @include breadcrumbsHover($D60, transparentize($D80, .9));\n}\n\n.item:not(.disabled):not(.active) {\n  cursor: pointer;\n}\n\n.disabled {\n  tab-index: -1;\n  cursor: default;\n}\n\n.itemContainer {\n  display: inline-flex;\n  align-items: center;\n}\n\n.divider {\n  display: inline-block;\n  width: 6px;\n  min-height: 30px;\n  margin: 0 8px;\n  background: url('../assets/arrow-right-icon.svg') no-repeat 50% 50%;\n}\n\n.button {\n  background: transparent;\n  border: 0;\n  padding: 0;\n\n  &:not(.disabled):not(.active) {\n    cursor: pointer;\n  }\n}\n\n.link {\n  color: inherit;\n  text-decoration: inherit;\n}\n\n:global(.rtl) {\n  .breadcrumbs {\n    direction: rtl;\n  }\n\n  .divider {\n    transform: rotate(180deg);\n  }\n}\n"}});